import {Test, TestText} from "../styled-components/Test.style"
import {AppContainer} from '../styled-components/Container.style'
function App() {
  return (
    <AppContainer>
      <Test backgroundColor = "blue"><TestText>Testing</TestText></Test>
      <Test backgroundColor = "white"/>
      <Test backgroundColor = "red"/>
    </AppContainer>
  );
}

export default App;
